<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <title>Redirecting...</title>
    <script>
      // GitHub Pages SPA redirect
      var l = window.location;
      var repo = "/AOSX-GamePlayer";
      var newUrl =
        repo +
        "/?p=" +
        encodeURIComponent(l.pathname.replace(repo, "")) +
        "&q=" +
        encodeURIComponent(l.search) +
        "&h=" +
        encodeURIComponent(l.hash);
      l.replace(newUrl);
    </script>
  </head>
  <body></body>
</html>
